    error_type1: ["error logs array of type 1"],
    error_type2: ["error logs array of type 2"]
  }
},
{
  _id: 11, ///month wise group
  logs: {
    error_type1: ["error logs array of type 1"],
    error_type2: ["error logs array of type 2"]
  }
}]
</code></pre>

