Mongo Query Nested Field Values with two-level unknown parent keys<p>We use MongoDB to store time-series sensor data similar to the schema designed shown in <a href="https://www.mongodb.com/blog/post/schema-design-for-time-series-data-in-mongodb" rel="nofollow noreferrer">https://www.mongodb.com/blog/post/schema-design-for-time-series-data-in-mongodb</a> </p>

<p>We do get good performance on data queries through time periods. 
Explanation on the our schema design: 
<strong>"v"</strong> is the parent key of sensor readings, the time is converted into nested array using Minutes and Seconds. We use <strong>"m"</strong>(Minute) as sub-parent key, then <strong>"s"</strong>(Second) as sub-key of minute reading. The sensor readings are located at the <strong>"s"</strong> level with <strong>field1</strong>, <strong>field2</strong>, ...,<strong>field10</strong> as the sensor data values. </p>

<p>Now we are trying to implement some data analysis facilities and looking to query the data through sensor data reading values.  Is there an efficient way of querying from data without using nested for loop in the query? </p>

<p>for example:</p>

<ol>
<li>Items that have sensor reading: <strong>"field1">2</strong> </li>
<li>Items that have sensor reading: <strong>"field1">2</strong> and  <strong>"field3">5</strong></li>
</ol>

<p>Thanks a million. </p>

